import { Component } from '@angular/core';
import {
  componentWrapperDecorator,
  moduleMetadata,
  type Meta,
  type StoryObj,
} from '@storybook/angular';
import { DsvButtonComponent } from '../../button';
import { ToastType } from '../dto/toast.dto';
import { ToastService } from '../service/toast.service';
import { DsvToastComponent } from './toast.component';

export const ActionsData = {};

const meta: Meta<DsvToastComponent> = {
  title: 'dsv/Toast',
  component: DsvToastComponent,
  excludeStories: /.*Data$/,
  tags: ['autodocs'],
  args: {
    ...ActionsData,
  },
};

export default meta;
type Story = StoryObj<DsvToastComponent>;

@Component({
  selector: 'toast-button-demo',
  imports: [DsvButtonComponent],
  template: `
    <div class="flex" style="gap: 5px;">
      <dsv-button
        color="success"
        (callback)="click()"
        icon="ri-check-fill"
        libelle="Success"
      ></dsv-button>
      <dsv-button
        color="info"
        (callback)="click('info')"
        icon="ri-information-2-line"
        libelle="Info"
      ></dsv-button>
      <dsv-button
        color="warning"
        (callback)="click('warning')"
        icon="ri-alert-line"
        libelle="Warning"
      ></dsv-button>
      <dsv-button
        color="error"
        (callback)="click('error')"
        icon="ri-close-line"
        libelle="Error"
      ></dsv-button>
    </div>
  `,
})
class PrimaryButtonDemo {
  constructor(private readonly toastService: ToastService) { }

  click(type: ToastType = 'success') {
    this.toastService.showToast({ text: type + ' ' + Math.floor(Math.random() * 101), type: type });
  }
}

export const Default: Story = {
  args: {},
  decorators: [
    moduleMetadata({
      imports: [PrimaryButtonDemo],
    }),
    componentWrapperDecorator((story) => {
      return `
        <div style="height: 300px"><toast-button-demo />${story}</div>
      `;
    }),
  ],
};

import { Component } from '@angular/core';
import { FormControl, FormGroup, ReactiveFormsModule, Validators } from '@angular/forms';
import { moduleMetadata, type Meta, type StoryObj } from '@storybook/angular';
import { FormCheckboxComponent, FormInputComponent, FormSelectComponent } from '../../public-api';
import { FormComponent } from './form.component';

export const ActionsData = {
  urlBack: '/',
};

@Component({
  selector: 'storybook-wrapper',
  standalone: true,
  imports: [FormComponent, FormInputComponent, FormCheckboxComponent, FormSelectComponent, ReactiveFormsModule],
  template: `
    <app-form [form]="form" [urlBack]="urlBack" (callback)="callback()">
      <dsv-form-input [form]="form" field="name" />
      <dsv-form-input [form]="form" type="number" field="number" />
      <dsv-form-input [form]="form" type="datetime-local" field="date" />
      <dsv-form-input [form]="form" type="textarea" field="textarea" />
      <dsv-form-select [form]="form" field="select" [list]="[{id: '', name: ''}, {id: '1', name: 'Test'}]" />
      <dsv-form-checkbox [form]="form" field="checkbox" />
    </app-form>
  `,
  styles: [
    `
      :host {
        width: 100%;
      }
    `,
  ]
})
class StoryWrapperComponent {
  form = new FormGroup({
    name: new FormControl('', [Validators.required]),
    number: new FormControl(''),
    date: new FormControl(''),
    textarea: new FormControl('', [Validators.required]),
    select: new FormControl('', [Validators.required]),
    checkbox: new FormControl(false),
  });

  urlBack?: string;
  callback = () => alert('Callback appelé 🎉');
}

const meta: Meta<StoryWrapperComponent> = {
  title: 'dsv/Form',
  component: StoryWrapperComponent,
  excludeStories: /.*Data$/,
  tags: ['autodocs'],
  parameters: {
    controls: { exclude: ['form'] },
  },
  decorators: [
    moduleMetadata({
    }),
  ],
  argTypes: {},
  args: {
    ...ActionsData,
  },
};

export default meta;
type Story = StoryObj<StoryWrapperComponent>;

